@Welly Moder11 Sei sim. Se tem uma coisa que gosto é de leitura e informação. Muitas cidades e municípios suspenderam o carnaval.  Principalmente Pernambuco aonde acontece uma das maiores aglomerações (tirando SP e RJ). Nenhuma cidade ainda foi confirmado 100%, tudo vai girar em torno da nova cepa do covid 19 (Omicron). 

Eduardo Paes já deixou claro que se não houver condições não vai ter carnaval no rio também. Com certeza não vai ter se a nova cepa chegar em solo brasileiro.

Boa Noite

